import React from "react";

const Hero = () => {
  return (
    <div className="container">
      <div>
        <img
          src="/images/about.jpg"
          alt=""
          style={{ height: "600px" }}
          className=" w-screen object-cover"
        />
        <div class="absolute inset-0 bg-black opacity-30"></div>
        <p>Home &gt; About</p>
        <h1 className="5xl font-bold font-sans">About</h1>
      </div>
    </div>
  );
};

export default Hero;
